package pers.yibo.algorithms.leetcode;

import java.util.LinkedHashMap;

/**
 * 423. 从英文中重建数字
 * <p>
 * https://leetcode-cn.com/problems/reconstruct-original-digits-from-english/
 * <p>
 * 给你一个字符串 s ，其中包含字母顺序打乱的用英文单词表示的若干数字（0-9）。按 升序 返回原始的数字。
 *
 * @author yibo
 * @date 2021-11-24 10:04
 **/
public class ReconstructOriginalDigitsFromEnglish {

    public static LinkedHashMap<Integer, Character> map = new LinkedHashMap<>(10);

    static {
        // zero z 独有
        map.put(0, 'z');
        // two w 独有
        map.put(2, 'w');
        // four u 独有
        map.put(4, 'u');
        // six x 独有
        map.put(6, 'x');
        // eight g 独有
        map.put(8, 'g');
        // one 剩余的 o 独有，减去0和2和4
        map.put(1, 'o');
        // three 剩余的 r 独有，减去4和0
        map.put(3, 'r');
        // five 剩余的 f 独有，减去4
        map.put(5, 'f');
        // seven 剩余的 s 独有，减去6
        map.put(7, 's');
        // nine 剩余的 i 独有，减去6和8和5
        map.put(9, 'i');
    }

    public String originalDigits(String s) {
        int[] countAll = new int[26 + 'a'];

        for (int i = 0; i < s.length(); i++) {
            countAll[s.charAt(i)]++;
        }

        int[] count = new int[10];
        // 找到0 2 4 6 8
        count[0] = countAll['z'];
        count[2] = countAll['w'];
        count[4] = countAll['u'];
        count[6] = countAll['x'];
        count[8] = countAll['g'];
        // 修正1，3，5，7，9
        count[1] = countAll['o'] - (count[0] + count[2] + count[4]);
        count[3] = countAll['r'] - (count[0] + count[4]);
        count[5] = countAll['f'] - count[4];
        count[7] = countAll['s'] - count[6];
        count[9] = countAll['i'] - (count[5] + count[6] + count[8]);

        StringBuilder builder = new StringBuilder();

        for (int i = 0; i < 10; i++) {
            for (int j = 0; j < count[i]; j++) {
                builder.append(i);
            }
        }
        return builder.toString();
    }

    public static void main(String[] args) {
        ReconstructOriginalDigitsFromEnglish r = new ReconstructOriginalDigitsFromEnglish();
        String s = "";
        System.out.println(r.originalDigits(s));
    }
}
